import { useState } from 'react';


const Users  = () =>
{
    const [users, setUsers] = useState([])

    axios.get('http://localhost:4000/routingToFront/UsersDBFullData')
      .then(resp=> setUsers({users: resp.data}))

    return(
       <div>
       <h3>Users</h3>
        {users}
       </div>
    ) 
}

export default Users
